description:
Quick Sand (Robby D, Digital Playground / 2013)

Homicide detectives Tommy Gunn and his sexy female partner Chanel Preston are drawn to the ocean for more than just a weekend getaway. When local beach community homeowners start turning up dead after a string of robberies the only witnesses are the sexy young local female lifeguards. Enjoy this suspenseful erotic drama full of sex, lust, crime, and action on the who's who of saving lives or taking them.

Chanel Preston, Mick Blue, James Deen, Tommy Gunn, Xander Corvus, Anikka Albrite, Bill Bailey, Helly Mae Hellfire, Teal Conrad

